import './code.scss';

function Code() {
  return (
    <div className="code">
      <h1>
        C<span>O</span>DE
      </h1>
      <p>
        When I first learned about HTML/CSS in <b>2016</b>, I was fascinated by the whole new world
        that opened up to me. Since then, I have been creating webpages and experimenting with
        different programming languages. In 2018, I began working as a full-time front-end developer
        for a company that primarily used Vue.js. Throughout my journey, I have explored a wide
        range of new technologies and techniques, some of which I have continued to use extensively,
        while others I have only dabbled in. I have also gained experience with UI/UX elements,
        designing a few pages for fun (such as the one found here), and keeping an eye out for the
        latest trends in web design.
      </p>
    </div>
  );
}

export default Code;
